"104 :   public static Node parse(StaticSourceFile sourceFile,
105 :                            String sourceString,
106 :                            Config config,
107 :                            ErrorReporter errorReporter,
108 :                            Logger logger) throws IOException {
109 :     Context cx = Context.enter();
110 :     cx.setErrorReporter(errorReporter);
111 :     cx.setLanguageVersion(Context.VERSION_1_5);
112 :     CompilerEnvirons compilerEnv = new CompilerEnvirons();
113 :     compilerEnv.initFromContext(cx);
114 :     compilerEnv.setRecordingComments(true);
115 :     compilerEnv.setRecordingLocalJsDocComments(true);
116 : 
117 :     // ES5 specifically allows trailing commas
118 :     compilerEnv.setWarnTrailingComma(
119 :         config.languageMode == LanguageMode.ECMASCRIPT3);
120 : 
121 :     // Do our own identifier check for ECMASCRIPT 5
122 :     boolean acceptEs5 =
123 :         config.isIdeMode || config.languageMode != LanguageMode.ECMASCRIPT3;
124 :     compilerEnv.setReservedKeywordAsIdentifier(acceptEs5);
125 :     compilerEnv.setAllowKeywordAsObjectPropertyName(acceptEs5);
126 : 
127 :     compilerEnv.setAllowMemberExprAsFunctionName(false);
128 :     compilerEnv.setIdeMode(config.isIdeMode);
129 :     compilerEnv.setRecoverFromErrors(config.isIdeMode);
130 : 
131 :     Parser p = new Parser(compilerEnv, errorReporter);
132 :     AstRoot astRoot = null;
133 :     try {
134 :       astRoot = p.parse(sourceString, sourceFile.getName(), 1);
135 :     } catch (EvaluatorException e) {
136 :       logger.info(
137 :           "Error parsing " + sourceFile.getName() + ": " + e.getMessage());
138 :     } finally {
139 :       Context.exit();
140 :     }
141 :     Node root = null;
142 :     if (astRoot != null) {
143 :       root = IRFactory.transformTree(
144 :           astRoot, sourceFile, sourceString, config, errorReporter);
145 :       root.setIsSyntheticBlock(true);
146 :     }
147 :     return root;
148 :   }"

